DROP TABLE IF EXISTS `tm_mail_done_b`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tm_mail_done_b` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `work_no` varchar(255) NOT NULL COMMENT '业务流水',
  `bat_no` varchar(255) DEFAULT NULL COMMENT '消息批次号',
  `bat_order` smallint(11) DEFAULT NULL COMMENT '批次序号',
  `sender` varchar(255) DEFAULT NULL COMMENT '发件人',
  `sendee` varchar(255) DEFAULT NULL COMMENT '收件人账号',
  `sendee_na` varchar(255) DEFAULT NULL COMMENT '收件人登录名',
  `mail_cc` varchar(255) DEFAULT NULL COMMENT '抄送人',
  `operator` varchar(255) DEFAULT NULL COMMENT '操作人',
  `title` varchar(255) DEFAULT NULL COMMENT '邮件标题',
  `content` text COMMENT '邮件内容',
  `file_uri` varchar(255) DEFAULT NULL COMMENT '附件',
  `to_send_dm` datetime DEFAULT NULL COMMENT '要求发送时间',
  `send_dm` datetime DEFAULT NULL COMMENT '发送时间',
  `business_type` int(4) DEFAULT NULL COMMENT '业务类型 注册，审核。。',
  `msg_type` int(2) DEFAULT NULL COMMENT '消息类型 验证码、短消息、长消息',
  `receive_type` varchar(255) DEFAULT NULL COMMENT '消息渠道：短信、微信等',
  `msg_sort` int(2) DEFAULT NULL COMMENT '消息类别:业务通知、公告',
  `st` varchar(255) DEFAULT NULL COMMENT '发送状态',
  `fail_reason` varchar(255) DEFAULT NULL COMMENT '失败原因',
  `cr_dm` datetime DEFAULT NULL COMMENT '创建时间',
  `up_dm` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `index_name` (`to_send_dm`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=659 DEFAULT CHARSET=utf8 COMMENT='邮件发送表';
/*!40101 SET character_set_client = @saved_cs_client */;

